import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";

import First from "./First";
import Seconds from "./Seconds";

import "./App.css";
import "./reset.css";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
          <Route path="/First" element={<Frist />}>
            <First />
          </Route>
          <Route path="/Seconds" element={<Seconds />}>
            <Seconds />
          </Route>
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
